script: |
  super -f text -I q11679.spq | sort > q11679.out

inputs:
  - name: q11679.spq
    data: |
      SELECT ALL 49 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 * - col2 + + 12 BETWEEN - + col1 AND - col0;
  - name: tab1

outputs:
  - name: q11679.out
    data: |
      49
      49
      49
